import React from "react";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faHeart } from "@fortawesome/free-solid-svg-icons";

const Footer = () => {
  return (
    <div>
      <h1 className="text-lg font-merriweather text-center text-black dark:text-white pb-5">
        Made with <FontAwesomeIcon icon={faHeart} /> by Bara Kharseh
      </h1>
    </div>
  );
};

export default Footer;
